def my_func(input1: str) -> bool:
    # Helper function to evaluate a simple expression with two operands and an operator
    def evaluate(op1, operator, op2):
        if operator == '&':
            return op1 and op2
        elif operator == '|':
            return op1 or op2

    # Convert 't' and 'f' to True and False
    tokens = []
    for char in input1:
        if char == 't':
            tokens.append(True)
        elif char == 'f':
            tokens.append(False)
        else:
            tokens.append(char)

    # Stacks for operands and operators
    operand_stack = []
    operator_stack = []

    # Precedence of operators
    precedence = {'|': 1, '&': 2}

    for token in tokens:
        if isinstance(token, bool):
            operand_stack.append(token)
        else:
            while (operator_stack and
                   precedence[operator_stack[-1]] >= precedence[token]):
                operator = operator_stack.pop()
                right_operand = operand_stack.pop()
                left_operand = operand_stack.pop()
                operand_stack.append(evaluate(left_operand, operator, right_operand))
            operator_stack.append(token)

    # Final evaluation for remaining operators
    while operator_stack:
        operator = operator_stack.pop()
        right_operand = operand_stack.pop()
        left_operand = operand_stack.pop()
        operand_stack.append(evaluate(left_operand, operator, right_operand))

    return operand_stack[0]

