    def evaluate_expression(expression: str) -> bool:
        # Parse and evaluate the expression
        tokens = []
        i = 0
        while i < len(expression):
            if expression[i] in 'tf':
                tokens.append(expression[i] == 't')
            elif expression[i] in '|&':
                tokens.append(expression[i])
            i += 1

        # Evaluate AND operations first
        i = 0
        while i < len(tokens):
            if tokens[i] == '&':
                left = tokens[i - 1]
                right = tokens[i + 1]
                tokens[i - 1:i + 2] = [left and right]
                i -= 1  # Step back to check for consecutive ANDs
            i += 1

        # Evaluate OR operations
        result = tokens[0]
        for i in range(1, len(tokens)):
            if tokens[i] == '|':
                result = result or tokens[i + 1]

        return result

